import React from 'react';
import Search from './search';
import Box from './box';


class MyApp extends React.Component{
    render(){
        return(
            <div style={{backgroundImage:"URL(https://www.priceline.com/home/public/assets/images/photos/pcln-hp-hero-mountain-lounge.jpg)"}}>


                <Box head="Save more on your next hotel" sub="Thousands of deals made every day"/>
                <Box head="Save more on your next hotel" sub="Thousands of deals made every day"/>
                <Search />

            </div>
        );
    }
}

export default MyApp;
